import React, { useEffect, useState } from 'react';
import Navbar from './navbar';
import users from './user.js'; // Importing the users array
import './profile.css';

const Profile = () => {
    const [loggedInUser, setLoggedInUser] = useState(null);

    useEffect(() => {
        const User = localStorage.getItem("User");
        if (User) {
            const user = users.find(u => u.name === User);
            if (user) {
                setLoggedInUser(user);
            }
        }
    }, []);

    return (
        <div className="profile">
            <Navbar />
            <div className="profile-container">
                <h1>User </h1>
                {loggedInUser ? (
                    <form className="user-details">
                        <label>Name:</label>
                        <input type="text" value={loggedInUser.name} readOnly />

                        <label>Email:</label>
                        <input type="text" value={loggedInUser.email} readOnly />

                        <label>Phone:</label>
                        <input type="text" value={loggedInUser.phone} readOnly />
                    </form>
                ) : (
                    <p className="error-msg">No user logged in</p>
                )}
            </div>
        </div>
    );
};

export default Profile;
